import React from 'react';
import styled from 'styled-components';
import Plx from 'react-plx';
import FeatureInfo from './FeatureInfo'
import { 
  featureGroupPlx,
  featureOnePlx,
  featureTwoPlx,
  featureThreePlx,
} from '../plxSettings'

const StyledSlideFive = styled.div`
  position: relative;
  height: 100vh;
  width: 100vw;

  .feature-group-plx {
    width: 90vw;
    margin: 0vw 5vw 0vw 5vw;
    display: flex;
    flex-direction: row;
    justify-content: space-between;
    position: absolute;
    bottom: -40vh;

    .feature-one-plx, .feature-two-plx, .feature-three-plx {
      opacity: 0;
    }
  }
`;

function SlideFive() {
  return (
    <StyledSlideFive>
      <Plx
        className='feature-group-plx'
        parallaxData={featureGroupPlx}
      >
        <Plx
          className='feature-one-plx'
          parallaxData={featureOnePlx}
        >
          <FeatureInfo
            title='SIMPLE MONTHLY PLANNING'
            description='No more restricting leases or loans. Simple month-to-month pricing. No hidden fees!'
          />
        </Plx>
        <Plx
          className='feature-two-plx'
          parallaxData={featureTwoPlx}
        >
          <FeatureInfo
            title='VEHICLE INSURANCE INCLUDED'
            description="That's right, you're protected. All Eleanor plans include full insurance coverage."
          />
        </Plx>
        <Plx
          className='feature-three-plx'
          parallaxData={featureTwoPlx}
        >
          <FeatureInfo
            title='MAINTENANCE IS COVERED'
            description="Leave it to us. Don't worry about maintaining your vehicle. Eleanor covers that as well."
          />
        </Plx>
      </Plx>
    </StyledSlideFive>
  );
}

export default SlideFive;
